import { useState } from "react";

const Book = (props) => {
  /* individual Books shelf  */

  const [inBook, setInBook] = useState({});
  const id = props.id;

  console.log("this is from props", id);

  return (
    <div>
      <h3>Book: {inBook.title}</h3>
      <small>
        <em>
          Id: {props.id}, Author:<b>{inBook.author}</b>, ReleaseDate:{" "}
          {inBook.releaseDate}
        </em>
      </small>
      <hr />
    </div>
  );
};

export default Book;
